@import url("https://fonts.googleapis.com/css2?family=Azeret+Mono:wght@500&display=swap");
body {
    background: #dddddd;
    margin: 0;
    font-family: "Azeret Mono";
}

.navbar div {
    display: flex;
    font-family: "Azeret Mono";
    background: #222831;
    padding: 1em;

    .text-logo {
        text-decoration: none;
        font-weight: bold;
        color: #dddddd;
        font-size: 2em;
        letter-spacing: 0.2em;
        padding-left: 2em;
        padding-top: 0.2em;

        span {
            color: #f05454;
        }
    }

    .navigation-paths {
        padding-left: 25em;
        display: flex;
        list-style: none;

        a {
            font-weight: normal;
            font-size: 1em;
            margin-left: 1.8em;
            text-decoration: none;
            color: whitesmoke;
        }
    }
}

.playing-field {
    padding-top: 0em;
    padding-bottom: 0em;
    margin-bottom: 2em;
   
    display: flex;
    .profile-pic {
        padding-left: 20em;

        .name {
            font-size: 0.9em;
        }

        p {
            font-size: 0.6em;
        }

        img {
            width: 15em;
            height: 15em;
            border-radius: 1em;
            margin-top: 3.5em;
        }
    }
    .about-me {
      
    
        p {
            margin-top: 3.3em;
            margin-left: 1em;
            padding-right: 20.5em;
            padding-left: 0.5em;
            padding-top: 0.5em;

            padding-bottom: 00.5em;
            border-radius: 1em;
            text-align: justify;
            background: #ffe98a;
            
        }
         
    }
}
.crybaby-hero {
    text-align: center;
}

.machine-problems {
    text-align: center;
    background: #30475e;


    img{
       padding: 2em 2em 0em 2em;

        width: 10em;
        height: 10em;
    }
    ul {
        color: #dddddd;
        display: flex;
      
       

        list {
    
           padding-left: 0.7em;
            h3 {
                font-size: 0.8em;
            }
            h4{
                font-size: 0.6em;
            }
        }

      
    }
    
}

.maker-info {
    
    margin-top: 4em;
    
    p {
        text-align: center;
        color: black;
        font-size: 0.6em;
        padding-top: 0.4;
    }
    img{
        width: 2em;
        height: 2em;
      
    }
}
